class Solution {
    fun beautifulSubstrings(s: String, k: Int): Long {
        val vowels = "aeiou"
        var beautifulCount = 0L
        val freq = IntArray(s.length + 1) { 0 }

        for (i in 1..s.length) {
            freq[i] = freq[i - 1] + if (vowels.contains(s[i - 1])) 1 else -1
        }

        val countMap = mutableMapOf<Int, Int>()

        for (f in freq) {
            for (j in -s.length..s.length) {
                if ((f - j) * (f - j) % k == 0 && countMap.containsKey(j)) {
                    beautifulCount += countMap[j]!!
                }
            }
            countMap[f] = countMap.getOrDefault(f, 0) + 1
        }

        return beautifulCount
    }
}
